description:
Regie: Teo Konuralp 
Cast: Sinead McCafferty, Dorothy Drury , Jennifer Dorogi 
Genre: Actie 
Land: Verenigde Staten 
Tijdsduur: 85 minuten


Een populaire straatracer wordt gedwongen na een tragisch ongeluk tijdelijk te stoppen met racen om bij te komen. Maar terwijl hij langzamerhand opknapt, wil hij weer meedoen aan deze straatraces. Maar het gruwelijke ongeluk vergeten en gewoon weer in de auto stappen is toch moeilijker dan het lijkt.  

